import React, { useState } from 'react';
import axiosInstance from '../utils/axiosInstance';
import { useAuth } from '../contexts/AuthContext';

// Simple Alert component
const Alert = ({ children, variant }) => (
  <div className={`p-4 mb-4 rounded-md ${variant === 'destructive' ? 'bg-red-100 text-red-700' : 'bg-green-100 text-green-700'}`}>
    {children}
  </div>
);

// Simple AlertDialog component
const AlertDialog = ({ children, isOpen, onClose }) => {
  if (!isOpen) return null;
  return (
    <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center">
      <div className="bg-white p-6 rounded-lg">
        {children}
        <button onClick={onClose} className="mt-4 bg-gray-200 px-4 py-2 rounded">Close</button>
      </div>
    </div>
  );
};

const AccountTab = ({ profile, onAccountUpdate }) => {
  const [isLoading, setIsLoading] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const [isDialogOpen, setIsDialogOpen] = useState(false);
  const { logout } = useAuth();

  const handleCancelSubscription = async () => {
    setIsLoading(true);
    setError('');
    setSuccess('');
    try {
      const response = await axiosInstance.post('/api/subscription/cancel');
      setSuccess(`Your subscription has been cancelled. You will have access to premium features until ${new Date(response.data.cancelAt).toLocaleDateString()}.`);
      onAccountUpdate(); // Refresh the profile data
      setIsDialogOpen(false);
    } catch (err) {
      setError('Failed to cancel subscription. Please try again.');
      console.error('Error cancelling subscription:', err);
    } finally {
      setIsLoading(false);
    }
  };

  const renderSubscriptionDetails = () => (
    <div className="space-y-2">
      <p><strong>Subscription Tier:</strong> {profile.subscriptionTier}</p>
      <p><strong>Subscription Status:</strong> {profile.subscriptionActive ? 'Active' : 'Inactive'}</p>
      {profile.subscriptionEndDate && (
        <p><strong>Subscription End Date:</strong> {new Date(profile.subscriptionEndDate).toLocaleDateString()}</p>
      )}
    </div>
  );

  const renderCancelButton = () => (
    <>
      <button
        className="bg-red-600 text-white px-4 py-2 rounded-md hover:bg-red-700 disabled:opacity-50"
        onClick={() => setIsDialogOpen(true)}
        disabled={isLoading}
      >
        {isLoading ? 'Processing...' : 'Cancel Subscription'}
      </button>
      <AlertDialog isOpen={isDialogOpen} onClose={() => setIsDialogOpen(false)}>
        <h2 className="text-lg font-bold mb-2">Are you sure you want to cancel?</h2>
        <p>Your subscription will be cancelled at the end of the current billing cycle. You will continue to have access to premium features until then.</p>
        <div className="mt-4 flex justify-end space-x-2">
          <button onClick={() => setIsDialogOpen(false)} className="px-4 py-2 bg-gray-200 rounded">No, keep my subscription</button>
          <button onClick={handleCancelSubscription} className="px-4 py-2 bg-red-600 text-white rounded">Yes, cancel at end of billing cycle</button>
        </div>
      </AlertDialog>
    </>
  );

  return (
    <div className="space-y-6">
      <h2 className="text-2xl font-bold">Account Details</h2>
      {renderSubscriptionDetails()}
      
      {profile.subscriptionActive && !profile.cancellationRequested && renderCancelButton()}

      {profile.cancellationRequested && (
        <Alert>
          <strong>Subscription Cancellation Requested</strong>
          <p>Your subscription will end on {new Date(profile.subscriptionEndDate).toLocaleDateString()}. You will continue to have access to premium features until then.</p>
        </Alert>
      )}
      
      {error && (
        <Alert variant="destructive">
          <strong>Error</strong>
          <p>{error}</p>
        </Alert>
      )}

      {success && (
        <Alert>
          <strong>Success</strong>
          <p>{success}</p>
        </Alert>
      )}
      
      <div className="mt-8">
        <h3 className="text-xl font-semibold mb-4">Danger Zone</h3>
        <button 
          onClick={() => {/* Implement account deletion logic */}}
          className="bg-red-600 text-white px-4 py-2 rounded-md hover:bg-red-700"
        >
          Delete Account
        </button>
      </div>
    </div>
  );
};

export default AccountTab;
